import "./App.css";
import "./java.js";
import axios from "axios";



function App() {
  return (
    <div className="App">
      div
    </div>
  );
}

function login(e) {
  e.preventDefault();
  let request = {
    email: document.getElementById("exampleInputEmail1").value,
    password: document.getElementById("exampleInputPassword1").value,
  }
  axios
    .post("http://localhost:8080/login", request)
    .then(resp => {
      alert(resp.data.message);
    })
    .catch((err) => {
      console.log(err);
    });
}

export default App;
